import React from "react";
import classes from './DocCard.module.css';

const DocCard = props => (
    
    <div className={classes.DocCard}>
        
        <div className={classes.Image}><img src={require(`../../../assets/images/docImgs/${props.docInfo.docImg}`)} alt="Doctor's Image" /></div>
        {console.log(props.docInfo.docImg)}
        
        <div className={classes.Info}>
            <div>
                <h1>{props.docInfo.name}</h1>
                <h3>{props.docInfo.specialization
                    .map(
                        (sp, i) => i!=props.docInfo.specialization.length - 1 ? sp + ', ' : sp )}
                </h3>
                <h3>{props.docInfo.education
                    .map(
                        (edu, i) => i!= props.docInfo.specialization.length - 1 ? edu.degree + ', ' : edu.degree)}
                </h3>
            </div>
            

        </div>

    </div>
    
);



export default DocCard
